  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `create_date` datetime DEFAULT current_timestamp(),
  `body` varchar(1000) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
